import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({contacts}) => {
  return (
    <div>
      {contacts.map((contact, index)=> ( <Tile key={index} name={contact.name} email={contact.email} phone={contact.phone} /> ))}
    </div>
  );
};
